You can use `json` or `jsonb` type in PostgreSQL. In TypeORM you can use `json` or `jsonb` type in your entity.

```
@Entity()
export class MyEntity {
  @Column('json')
  myJson: any;
}
```

or

```
@Entity()
export class MyEntity {
  @Column('jsonb')
  myJson: any;
}
```

